measurements.description:
Nine flowers on one 73-cm, inflorescence;
 sepals and petals dark rose edged cream, darker rose venation, heaviest on midrib, elliptical;
 lip cream, midlobe marked intense darker rose and dark rose, picottee, side lobes marked dark rose,  
 callus yellow, spotted red;
 column cream, blushed and spotted dark rose, anther cap cream edged dark rose; substance hard; texture matte.
